import { TextField } from "@mui/material";

const Main = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <div
        style={{
          height: "70vh",
          width: "40%",
          borderRadius: 10,
          border: "1px solid orange",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <div
          style={{
            height: "60%",
            width: "60%",
          }}
        >
          <TextField
            fullWidth
            id="outlined-basic"
            label="Outlined"
            variant="outlined"
            top="20px"
          />
          <TextField
            fullWidth
            id="outlined-basic"
            label="Outlined"
            variant="outlined"
          />
        </div>
      </div>
    </div>
  );
};

export default Main;
